// n seqaure sol : brute force
var singleNumber1 = function(nums) {
    let result = [0, 0];
    let index = 0;
    let n = nums.length;

    for (let i = 0; i < n; i++) {
        let found = false;
        for (let j = 0; j < n; j++) {
            if (i !== j && nums[i] === nums[j]) {
                found = true;
                break;
            }
        }
        if (!found) {
            result[index++] = nums[i];
            if (index === 2) {
                break;
            }
        }
    }

    return result;
};

// written by self: doesn't work for all cases. 32/33 cases passed
function singleNumber2(nums) {
    
    const arrXor = getXorOfArr(nums);

    // we need to find right-most set bit of "xor"
    const binaryRepOfArrXor = Number(arrXor).toString(2)
    let lastIndexOfSetBit = [...binaryRepOfArrXor].lastIndexOf("1");
    // index from right side
    let setBitIndex =  binaryRepOfArrXor.length - lastIndexOfSetBit - 1;

    // all numbers with setBitIndex = 1 will go to bucket 1 and other will be bucket2
    // this will make sure our numbers will result into different buckets and same numbers
    // will always result in same bucket
    let bucket1 = [], bucket2 = [];
    for(let i=0; i<nums.length; i++) {
        let binaryRep = Number(nums[i]).toString(2);
        
        if(binaryRep.length <= setBitIndex) {
            bucket2.push(nums[i]);
        } else {
            if(binaryRep[binaryRep.length-setBitIndex-1] === "1") bucket1.push(nums[i]);
            else bucket2.push(nums[i]);
        }
      
    }

    console.log(bucket1.length)
    console.log(bucket2.length)
  
    let num1 = getXorOfArr(bucket1);
    let num2 = getXorOfArr(bucket2);
    console.log([num1, num2])
    return [num1, num2]
    
    function getXorOfArr(arr) {
        let xor = arr[0];
        for(let i=1; i<arr.length; i++) {
            xor = xor ^ arr[i]
        }
        return xor;
    }

    
}

function singleNumber(nums) {
    let xorr = nums.reduce((acc, num) => acc ^ num, 0);
    let rightMost = (xorr & xorr-1) ^ xorr;
    let b1 =0, b2 = 0;
    for(let i=0; i<nums.length; i++) {
        if(nums[i] & rightMost) b1 = b1 ^ nums[i]
        else b2 = b2 ^ nums[i]
    }
    console.log([b1, b2])
    return [b1, b2]
}



